import pydantic


class RETCODE:
    OK = 0
    ERROR = -1
    CHANGE_FORMAT_ERROR = 3001
    RECOGNIZE_EMPTY_ERROR = 3002
    OUT_OF_SUPPORT = 2


err_msg = {
    RETCODE.OK: "请求成功",
    RETCODE.ERROR: "识别异常",
    RETCODE.OUT_OF_SUPPORT: "超出支持范围",
    RETCODE.CHANGE_FORMAT_ERROR: "格式转换失败",
    RETCODE.RECOGNIZE_EMPTY_ERROR: "识别结果为空"
}


class ReqType:
    IdentityCard = 1
    BirthCert = 2
    PassPort = 3
    HkMacaoPermit = 4
    Degree = 5


class RespType(ReqType):
    Unknown = 0
    IdentityCardFront = 6
    IdentityCardBack = 7
    HkMacaoPermitFront = 8
    HkMacaoPermitBack = 9


class InterfaceError(pydantic.BaseModel):
    code: str
    message: str
